import React from "react";

const MovieCard = props => {
  return (
    <div style={{ width: "200px" }}>
      <h1>{props.title}</h1>
      <h4>{props.director}</h4>
      <p>{props.description}</p>
    </div>
  );
};

export default MovieCard;
